#  2023/7/13
from typing import List


class Solution:
    def minFallingPathSum(self, matrix: List[List[int]]) -> int:
        n = len(matrix)
        dp = matrix[0].copy()

        for i in range(1, n):
            temp = dp.copy()
            for j in range(n):
                dp[j] = matrix[i][j] + min([temp[j - 1] if 0 < j else 101 * n, temp[j], temp[j + 1] if j < n - 1 else 101 * n])
        return min(dp)


